// ScrollSpyComponent.js
import React from 'react';
import Scrollspy from 'react-scrollspy';
import Nav from 'react-bootstrap/Nav';

const ScrollSpy1 = () => {
  return (
    <div>
     
      <Nav >
        <Scrollspy
          items={['section1', 'section2', 'section3', 'section4', 'section5']}
          currentClassName="active" 
        >
            <Nav.Item >
             <Nav.Link href="#section2"><h4>Home</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item >
              <Nav.Link href="#section1"><h4>About Us</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item >
             <Nav.Link href="#section3"><h4>Services</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item>
             <Nav.Link href="section4"> <h4>Contact Us</h4></Nav.Link>
         </Nav.Item>
         <Nav.Item>
             <Nav.Link href="section5"> <h4>Contact Us</h4></Nav.Link>
         </Nav.Item>
        </Scrollspy>
      </Nav>
    </div>
  );
};

export default ScrollSpy1;
